const valores = {
    uno: 1,
    dos: 2,
    tres: 3
 }

const initialState = {
    Amount : 0
}

export const amountReducer = (state = initialState, action) => {
    switch (action.Amount) {
        case valores.uno:
            return valores.uno
            break
        case valores.dos:
            return valores.dos
            break
        case valores.tres:
            return valores.tres
            break
        
        default:
            return state
            break;
    }
    
}
